import React, { useState, ChangeEvent } from 'react';
import { submitForm } from "../../services/apiService";

interface ThriveIntakeFormData {
  intakeDate: string;
  navigatorName: string;
  programType: {
    ORIA: boolean;
    EMM: boolean;
    InternalReferral: boolean;
    ORIAOptions: string[]; // Sub-options for ORIA
    InternalReferralOptions: string[]; // Sub-options for Internal Referral
    asylumDateGranted: string;
    alienNumber: string; // Add this
    eligibilityDate: string; // Add this
  };
  firstName: string;
  lastName: string;
  dateOfBirth: string;
  gender: string;
  countryOfOrigin: string;
  phoneNumber: string;
  emailAddress: string;
  address: string;
  immigrationStatus: string[];
  asylumDateGranted: string; 
  alienNumber: string;
  eligibilityDate: string;
  programEligibility: {
    receivingServices: boolean | undefined;
    ageOver16: boolean | undefined;
    livesInWashington: boolean | undefined;
    arrivedAfterJuly2021: boolean | undefined;
    approvedImmigrationStatus: boolean | undefined;
    consentFormCompleted: boolean | undefined;
    releaseFormCompleted: boolean | undefined;
    immigrationStatusCopy: boolean | undefined;
  }
  servicesNeeded: string[];
}

const ThriveIntakeForm: React.FC = () => {
  const [formData, setFormData] = useState<ThriveIntakeFormData>({
    intakeDate: '',
    navigatorName: '',
    programType: {
      ORIA: false,
      EMM: false,
      InternalReferral: false,
      ORIAOptions: [],
      InternalReferralOptions: [],
      asylumDateGranted: '',
      alienNumber: '',
      eligibilityDate: '',
    },
    firstName: '',
    lastName: '',
    dateOfBirth: '',
    gender: '',
    countryOfOrigin: '',
    phoneNumber: '',
    emailAddress: '',
    address: '',
    immigrationStatus: [],
    asylumDateGranted: '',
    alienNumber: '',
    eligibilityDate: '',
    programEligibility: {
      receivingServices: undefined,
      ageOver16: undefined,
      livesInWashington: undefined,
      arrivedAfterJuly2021: undefined,
      approvedImmigrationStatus: undefined,
      consentFormCompleted: undefined,
      releaseFormCompleted: undefined,
      immigrationStatusCopy: undefined,
    },
    servicesNeeded: [],
  });




  const handleChange = (e: ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
    const { name, value, type, checked } = e.target as HTMLInputElement;

    if (type === 'checkbox') {
      if (name === 'immigrationStatus') {
        setFormData((prev) => ({
          ...prev,
          immigrationStatus: checked
            ? [...prev.immigrationStatus, value]
            : prev.immigrationStatus.filter((item) => item !== value),
        }));
      } else if (name.startsWith('programType.')) {
        const field = name.split('.')[1];
        setFormData((prev) => ({
          ...prev,
          programType: {
            ...prev.programType,
            [field]: checked,
          },
        }));
      } else if (name.startsWith('ORIAOptions.')) {
        const option = name.split('.')[1];
        setFormData((prev) => ({
          ...prev,
          programType: {
            ...prev.programType,
            ORIAOptions: checked
              ? [...prev.programType.ORIAOptions, option]
              : prev.programType.ORIAOptions.filter((item) => item !== option),
          },
        }));
      } else if (name.startsWith('InternalReferralOptions.')) {
        const option = name.split('.')[1];
        setFormData((prev) => ({
          ...prev,
          programType: {
            ...prev.programType,
            InternalReferralOptions: checked
              ? [...prev.programType.InternalReferralOptions, option]
              : prev.programType.InternalReferralOptions.filter((item) => item !== option),
          },
        }));
      } else if (name === 'servicesNeeded') {
        setFormData((prev) => ({
          ...prev,
          servicesNeeded: checked
            ? [...prev.servicesNeeded, value]
            : prev.servicesNeeded.filter((item) => item !== value),
        }));
      } else if (name.endsWith('.yes')) {
        const field = name.replace('.yes', '');
        setFormData((prev) => ({
          ...prev,
          programEligibility: {
            ...prev.programEligibility,
            [field]: true,
          },
        }));
      } else if (name.endsWith('.no')) {
        const field = name.replace('.no', '');
        setFormData((prev) => ({
          ...prev,
          programEligibility: {
            ...prev.programEligibility,
            [field]: false,
          },
        }));
      }
    } else {
      setFormData((prev) => ({
        ...prev,
        [name]: value,
      }));
    }
  };









  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    const formattedData = {
      ...formData,
      intakeDate: formData.intakeDate ? new Date(formData.intakeDate).toISOString() : new Date().toISOString(),  // Ensure intakeDate is never null
      dateOfBirth: formData.dateOfBirth ? new Date(formData.dateOfBirth).toISOString() : new Date().toISOString(),  // Ensure dateOfBirth is never null
      asylumDateGranted: formData.asylumDateGranted ? new Date(formData.asylumDateGranted).toISOString() : null,
      eligibilityDate: formData.eligibilityDate ? new Date(formData.eligibilityDate).toISOString() : null,
      programType: {
          ...formData.programType,
          asylumDateGranted: formData.programType.asylumDateGranted
              ? new Date(formData.programType.asylumDateGranted).toISOString()
              : null,
          eligibilityDate: formData.programType.eligibilityDate
              ? new Date(formData.programType.eligibilityDate).toISOString()
              : null,
      },
  };


    console.log("📤 Submitting formatted data:", JSON.stringify(formattedData, null, 2));

    try {
        const response = await submitForm("ThriveIntakeRegistration", formattedData);
        alert("✅ Thrive Intake Form submitted successfully!");
        console.log("✅ Response:", response);
    } catch (error) {
        console.error("❌ Error submitting form:", error);
        alert(`❌ Failed to submit form: ${error}`);
    }
};










  return (
    <div className="max-w-4xl mx-auto p-6 bg-white shadow-lg rounded-lg">
      <h1 className="text-3xl font-bold text-center mb-6">
        Thrive International Intake/Registration Form
      </h1>
      <form onSubmit={handleSubmit} className="space-y-6">
        {/* Intake Date and Navigator Name */}
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div>
            <label className="block text-sm font-medium text-gray-700">
              Intake Date
            </label>
            <input
              type="date"
              name="intakeDate"
              value={formData.intakeDate}
              onChange={handleChange}
              className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              required
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">
              Navigator Name
            </label>
            <input
              type="text"
              name="navigatorName"
              value={formData.navigatorName}
              onChange={handleChange}
              className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              required
            />
          </div>
        </div>

        {/* Program Type */}
        <div className="space-y-4">
          <label className="block text-sm font-medium text-gray-700">
            Program Type
          </label>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programType.ORIA"
                checked={formData.programType.ORIA}
                onChange={handleChange}
                className="mr-2"
              />
              ORIA
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programType.EMM"
                checked={formData.programType.EMM}
                onChange={handleChange}
                className="mr-2"
              />
              EMM
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programType.InternalReferral"
                checked={formData.programType.InternalReferral}
                onChange={handleChange}
                className="mr-2"
              />
              Internal Referral
            </label>
          </div>

          {/* ORIA Sub-Options */}




          {formData.programType.ORIA && (
  <div className="ml-6 space-y-2">
    <label className="block text-sm font-medium text-gray-700">
      ORIA Options
    </label>
    <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
      {['Affordable Housing', 'Teen & Kid Closet', 'Medical', 'Other'].map((option) => (
        <label key={option} className="flex items-center">
          <input
            type="checkbox"
            name={`ORIAOptions.${option}`}
            checked={formData.programType.ORIAOptions.includes(option)}
            onChange={handleChange}
            className="mr-2"
          />
          {option}
        </label>
      ))}
    </div>
  </div>
)}

{formData.programType.InternalReferral && (
  <div className="ml-6 space-y-2">
    <label className="block text-sm font-medium text-gray-700">
      Internal Referral Options
    </label>
    <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
      {['Economic Empowerment', 'Women\'s Empowerment', 'Youth Empowerment'].map((option) => (
        <label key={option} className="flex items-center">
          <input
            type="checkbox"
            name={`InternalReferralOptions.${option}`}
